import './App.css';
import React from "react";
import {BrowserRouter,Routes,Route} from "react-router-dom";

import About from "./routes/About";

function App() {
  return (
    <BrowserRouter>
      <Routes> 
        <Route path="/" element={<div>Default Page Content</div>} />
        <Route path="/about" element={<About />} />
      </Routes>
    </BrowserRouter>

  )
}

export default App;
